const memeImages = [
	`data:image/jpeg;base64,`,
	`data:image/jpeg;base64,`,
	`data:image/jpeg;base64,`,
	`data:image/jpeg;base64,`,
	`data:image/jpeg;base64,`,
	`https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrx43G1K8ifkRpJY9EqappbDDq9U7sMwVaFQ&usqp=CAU`,
	`https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSegYb2epcMVT18fN9eU5rjJIaqNwZFRdpQyw&usqp=CAU`,
];

const topCaption = document.querySelector('.top-caption');
const bottomCaption = document.querySelector('.bottom-caption');
const memeImg = document.getElementById('meme-img');
const generateBtn = document.getElementById('generate-btn');

generateBtn.addEventListener('click', generateMeme);

function generateMeme() {
	const randomIndex = Math.floor(Math.random() * memeImages.length);
	const randomImage = memeImages[randomIndex];

	memeImg.src = randomImage;
	topCaption.textContent = generateRandomCaption();
	bottomCaption.textContent = generateRandomCaption();
}

function generateRandomCaption() {
	const captions = [
		"When you realize it's Monday",
		'Me trying to understand CSS',
		'When the code finally works',
		'When you find a bug right before the demo',
		'That feeling when the coffee kicks in',
		'When you fix a bug without creating new ones',
		'Trying to explain your code during a code review',
		'When the client wants "just a small change"',
		'When the code you wrote at 3 AM actually works',
		'The face you make when the code breaks for no reason',
		'Trying to choose a variable name that makes sense',
		'Pair programming be like...',
		'Trying to make sense of legacy code',
		'When your code passes all the tests',
		'When you finally refactor that messy code',
		'Reading documentation like...',
		"When you see someone else's code",
		"When you realize it's Friday afternoon",
		'Searching for the missing semicolon like...',
		'Fixing Internet Explorer compatibility',
		'When you spot a typo in the comments',
		'When the boss asks for an "easy" feature',
		'Trying to figure out Git merge conflicts',
		'That feeling when you optimize the code',
		'Debugging be like...',
		'When you meet a deadline by the skin of your teeth',
		'When your code compiles without errors',
		'Trying to make CSS work for IE',
		'Coding marathon like...',
		'When you discover a new shortcut in your IDE',
		'When the code is so clean, you could eat off it',
		'Reading stack overflow answers be like...',
		'When your code becomes self-aware',
	];

	const randomIndex = Math.floor(Math.random() * captions.length);
	return captions[randomIndex];
}

generateMeme();
